import React from "react";
import {
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBCardLink,
} from "mdb-react-ui-kit";
import image from "./image.jpg";
import "./Dashboard.css";

const ContestHistory = () => {
  const contests = [
    {
        name: "Contest 1",
        image: image,
        startTime: "23-08-2024 at 9:30 AM",
        endTime: "23-08-2024 at 11:30 AM",
        participantLimit: 100,
        details: "url",

    },
    {
        name: "Contest 1",
        image: image,
        startTime: "23 December 2024 at 9:30 AM",
        endTime: "23-08-2024 at 11:30 AM",
        participantLimit: 100,
        details: "url",
    },
    {
        name: "Contest 1",
        image: image,
        startTime: "23 December 2024 at 9:30 AM",
        endTime: "23-08-2024 at 11:30 AM",
        participantLimit: 100,
        details: "url",
    }
    ,
    {
        name: "Contest 1",
        image: image,
        startTime: "23 December 2024 at 9:30 AM",
        endTime: "23-08-2024 at 11:30 AM",
        participantLimit: 100,
        details: "url",
    },
    {
        name: "Contest 1",
        image: image,
        startTime: "23 December 2024 at 9:30 AM",
        endTime: "23-08-2024 at 11:30 AM",
        participantLimit: 100,
        details: "url",
    }
  ];

  return (
    <div>
      <div>
        <h1>Contests</h1>
      </div>
      <div></div>
      <div>
        <MDBRow className="row-cols-1 row-cols-md-3 g-4">
          {contests.map((contest, index) => (
            <MDBCol key={index}>
              <MDBCard>
                <MDBCardImage
                  src={contest.image}
                  alt={index}
                  position="top"
                />
                <MDBCardBody>
                  <MDBCardTitle className="title">{contest.name}</MDBCardTitle>
                  <MDBCardText className="text">
                   Started On: <span className="right-text">{contest.startTime}</span>
                   Ends On: <span className="right-text">{contest.endTime}</span>
                   Participant Limit: <span className="right-text">{contest.participantLimit}</span>
                  </MDBCardText>
                  <MDBBtn>Join the contest</MDBBtn>
                  <MDBCardLink href={contest.details} c>Details</MDBCardLink>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
          ))}
        </MDBRow>
      </div>
    </div>
  );
};

export default ContestHistory;
